import { IonCol, IonContent, IonGrid, IonHeader, IonItem, IonPage, IonRouterLink, IonRow, IonSelect, IonSelectOption, IonText, IonTitle, IonToolbar } from '@ionic/react';
import React, { useRef, useState } from 'react';

import '../../css/Global.css';
import '../../css/Study@SIMProgList.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPaintBrush, faBriefcase, faDesktop, faUserNurse } from '@fortawesome/free-solid-svg-icons';
import { faStar } from '@fortawesome/free-regular-svg-icons';

import TopNav from '../../components/TopNav';
import Menu from '../../components/Menu';


const StudySIMProgList: React.FC = () => {
    

    return (
        <IonPage>
            <IonHeader>
                <TopNav title="Study@SIM" route='/u/home' backarrow={ true } hamburger = { true }/>
            </IonHeader>

            <IonContent fullscreen={true}>
                <IonGrid id="studySIMProgListGrid">
                    <IonRow id="studySIMProgListHeaderRow" class="ion-align-items-center">
                        <IonCol size="6" sizeSm="6" class="ion-text-left">
                            <IonTitle id="studyProgListTitle">Programmes</IonTitle>
                        </IonCol>
                    </IonRow>

                    <IonRow>
                        
                    </IonRow>

                </IonGrid>
            </IonContent>
        </IonPage>
    );
};

export default StudySIMProgList;
